const bubbleChartData = {
    datasets: [
      {
        label: "Investment 2",
        backgroundColor: "#3498db",
        borderColor: "#3498db",
        data: [
          { x: 10000, y: 15, r: 10 },
          { x: 20000, y: 30, r: 20 },
          { x: 30000, y: 45, r: 25 },
        ],
      },
      {
        label: "Investment 1",
        backgroundColor: "#e74c3c",
        borderColor: "#e74c3c",
        data: [
          { x: 15000, y: 20, r: 15 },
          { x: 8000, y: 35, r: 20 },
          { x: 5000, y: 50, r: 30 },
        ],
      },
      {
        label: "Investment 3",
        backgroundColor: "#e74c3c",
        borderColor: "#e74c3c",
        data: [
          { x: 35000, y: 20, r: 15 },
          { x: 12000, y: 35, r: 20 },
          { x: 65000, y: 50, r: 30 },
        ],
      },
    ],
  };

  export default bubbleChartData;
